import React from "react";
import "../common/style/table.css";

// import './Table.css'; // Import your CSS file for styling

const Table = () => {
  const tableData = [
    [
      "01",
      "www.google.com",
      "QB0GaK7",
      ["Select Tags", "Tag 1", "Tag 2", "Tag 3", "Tag 4"],
      "",
    ],
    [
      "02",
      "timesonline.co.uk",
      "Z9I2o9o",
      ["Select Tags", "Tag 1", "Tag 2", "Tag 3", "Tag 4"],
      "",
    ],
    [
      "03",
      "newyorker.com",
      "pW44149",
      ["Select Tags", "Tag 1", "Tag 2", "Tag 3", "Tag 4"],
      "",
    ],
    [
      "04",
      "angelfire.com",
      "c1TO1x6",
      ["Select Tags", "Tag 1", "Tag 2", "Tag 3", "Tag 4"],
      "",
    ],
    [
      "05",
      "state.gov",
      ["Select Tags", "nh294TY", "Tag 1", "Tag 2", "Tag 3", "Tag 4"],
      "",
    ],
  ];

  return (
    // <div>
    //   <span style={{marginTop: "50px"}}>
    //     <h3>Upload</h3>
    //   </span>
    // </div>
    <table className="custom-table">
      <thead>
        <tr>
          <th>SL No</th>
          <th>Links</th>
          <th>Prefix</th>
          <th>Add Tags</th>
          <th>Selected Tags</th>
        </tr>
      </thead>
      <tbody>
        {tableData.map((row, rowIndex) => (
          <tr key={rowIndex}>
            {row.map((cell, cellIndex) => (
              <td key={cellIndex}>{cell}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Table;
